INSERT INTO `orders` (`id`, `rowid`, `serial`, `user_id`, `status`, `type`, `schedule_at`, `table_serial`, `pay_type`, `receive_name`, `receive_phone`, `receive_address`, `paided`, `remark`, `total`, `paid_serial`, `paid_remark`, `created_at`, `updated_at`) VALUES
(1, 1, 'B-9789676977595', 3, 'TBP', 'B', '2021-07-05 09:00:59', '13', NULL, 'Name:繆筑郁', '(00)776-3550', '667 新竹縣橫山鄉竹社路三段944巷657號', 0, '鄰村去問，所以一向並沒有覺睡，不知道是阿Q便迎上去的了，便和我仿佛很舒服麽？老實說，一個字說道「請請」，他是自己，被槍斃便是舉人老爺，請他喝了兩點，是他們也假定他，只覺得無意的：這是你家小栓一眼，想。', 46336, '9786225323254', NULL, '2021-06-30 09:00:59', '2021-06-30 09:01:03'),
(2, 2, 'C-9794408965740', 2, 'ALC', 'C', '2021-07-06 09:00:59', '15', NULL, 'Name:松美琬', '(02)37102459', '745-95 新竹市北區花旗街192號38樓', 0, '怎樣的好罷。我說，「你不是回來，鼻翅子都拆開了，此後便已滿滿的，所以睡的只有一年的中央，一家是咸亨，卻辨得出許多辮子是被壞人灌醉了酒，老拱的肩頭，而且羞人。那是天氣還早，一定要有勾當了，伊又疑心，延。', 81803, '9789571007465', NULL, '2021-06-30 09:00:59', '2021-06-30 09:01:03'),
(3, 3, 'B-9799281249529', 6, 'ALC', 'B', '2021-07-06 09:00:59', 'A25', NULL, 'Name:戴賢', '+886994888816', '595-96 新竹市東區光榮路11巷270弄234號', 0, '動。 “女人當大眾這樣的收起飯菜。 可惜他又要皇恩大赦？——” “救命，移植到他們並不想到私刑拷打的刑具，木盤上面有著柵欄，倒向你奔來，也不見自己說，「這可惡的是怎麼動手去抱頭，拍的響，頗有些不通世。', 78547, '9780229918706', NULL, '2021-06-30 09:00:59', '2021-06-30 09:01:03'),
(4, 4, 'C-9783512849381', 6, 'ALD', 'C', '2021-07-03 09:00:59', 'E23', NULL, 'Name:滕瑜', '(047)061425', '988-83 桃園市龜山區甘肅路九段168號', 0, '如是等等妙法剋服怨敵之後，又發生了回憶者，當即傳揚開去，扯著何首烏藤，但我的職務了。 “打蟲豸，好在明天分文不像…… “發財，你們麽？」 「這回又完了！」 「開城門來～～！人和書籍紙張筆硯，一徑聯捷。', 88973, '9793995290921', '叫一聲，覺得一個很大，太陽光接著便將大不同，確乎終日吹著，誰都看見院子裏跳躍了。我因為這話，—— 我所記得哩。我早經收束，倒也沒有這麼高低。年紀小的也撿些草葉和兔毛，只記得哩。」他遲疑了片時，什麽似。', '2021-06-30 09:00:59', '2021-06-30 09:01:03'),
(5, 5, 'C-9780776024196', 7, 'ALD', 'C', '2021-07-04 09:00:59', 'A26', NULL, 'Name:溫信美', '(02)4301-5051', '381 澎湖縣七美鄉文莊街三段925號', 0, NULL, 91503, '9793816486861', NULL, '2021-06-30 09:00:59', '2021-06-30 09:01:03'),
(6, 6, 'C-9790627758378', 2, 'CLD', 'C', '2021-07-03 09:00:59', 'C27', 'P02', 'Name:歐陽雅', '0993421120', '610-88 嘉義縣番路鄉芳樂路九段547巷523號', 1, '方太太又告訴我說，「大船，就去問，——都放在枕頭底下抽出謄真的呢？夏夜，就是十六，我竟將書名忘卻了。這囚徒……”阿Q遲疑多時也疑心他孤高，質鋪和藥店裏也沒有叫喊。 伊覺得他的兒子初雋秀才的時候，給小。', 76616, '9780957519374', NULL, '2021-06-30 09:00:59', '2021-06-30 09:01:03'),
(7, 7, 'C-9782581389897', 5, 'ALC', 'C', '2021-07-02 09:00:59', '30', 'P04', 'Name:柴建', '(038)692853', '084 澎湖縣西嶼鄉大庄村田中路五段301巷113號', 1, NULL, 97177, '9785034672683', '的了。到晚飯本可以叫他爹爹，而叫天不可收，每年總付給趙白眼的這樣危險，逾垣進去了。所以先遇著了一句套話裏，專管我的文字的可笑！」雙喜先跳下船，幾個剪過辮子盤在頭上一片老荷葉回來，裝好一會，一副凶臉孔。', '2021-06-30 09:00:59', '2021-06-30 09:01:03'),
(8, 8, 'C-9796807454702', 10, 'TBP', 'C', '2021-07-03 09:00:59', 'F14', NULL, 'Name:鈄儀琬', '+886-948-296-098', '825 新竹市香山區文匯街三段919巷453號46樓', 0, '裏忽然看，因為他總是非常快，彷彿許多毫無價值的苦輪到我的父親叫我回到家裏只有假洋鬼子的脊樑上時，什麼？」孔乙己一到裏面大，辭退不得，鏘令鏘！” 他這樣說來，鼻翅子都在自己。孔乙己麼？”他搖搖頭。他說。', 58101, '9793005948972', '”“現在只在本年，新年到，閏土坐，將腰一伸，咿咿嗚嗚的就說出這樣罵。 華大媽也很不如一代不如改正了好。然而終於聽得分明，來得最早，一面聽，似乎發昏，有時也遇不到他也躲在人叢裏，又時時刻刻感著冷落的原。', '2021-06-30 09:00:59', '2021-06-30 09:01:03'),
(9, 9, 'A-9797620029856', 7, 'TBP', 'A', '2021-06-30 09:00:59', 'B15', NULL, 'Name:蔡宗瑋', '(077)419-395', '827 澎湖縣望安鄉乾興路七段794巷554弄241號26樓', 0, NULL, 22371, '9789676459992', '生理學並不提起關於中國來。 “這些事的畫片自然只有一個多打呵欠，終於用十二分的勇氣，豎起耳朵，動著鼻子，有時候，幫忙的人都聳起耳朵只在一個圈，在簷下的平橋村只有阿五的聲音，有的事是避之惟恐不遠，極偏。', '2021-06-30 09:00:59', '2021-06-30 09:01:03'),
