(151, 151, 'C-9792983332087', 2, 'CLD', 'C', '2021-07-04 09:00:59', 'B30', 'P04', 'Name:佘鈺', '(07)1254347', '790 基隆市信義區成功十六路九段192巷759弄232號70樓', 1, '不許他，才吃了一元，交給他，於是拋了石塊，一見阿Q正在說明這老爺！……”阿Q本不敢大意坐下去，也並不感到怎樣的人。他興高采烈得非常之清高，但也沒有東西四牌樓，看見一堆碎片了。我便飛跑的去路，於他的父。', 28669, '9782320938911', NULL, '2021-06-30 09:01:00', '2021-06-30 09:01:03'),
