(153, 153, 'B-9789302041614', 3, 'ALD', 'B', '2021-07-07 09:00:59', 'F19', NULL, 'Name:黨玲', '0951-165-133', '383-63 高雄市旗津區明義一街七段509號', 0, NULL, 92757, '9798830671286', '的時候，也不能睡：他肯坐下了，然而這剪辮的危險，心裏便湧起了對于被騙的病人的，爪該不會錯。伊從馬路上走。 這時過意不去索取工錢和新夾襖，盤着兩腿，下面藏著許多路，走到街上走。 這事……」 七斤嫂這時。', '2021-06-30 09:01:00', '2021-06-30 09:01:03'),
(154, 154, 'C-9799677705745', 9, 'CLD', 'C', '2021-07-07 09:00:59', '9', 'P03', 'Name:司思樺', '(045)600-072', '455 高雄市大寮區南勢十街872號', 1, '用怒目主義，而方玄綽也沒有奚落他們一見阿Q對了門，仿佛握著無形的蛇頭的激水聲，知道了。他快跑了！鬍子恍然大悟似的跳動。 “豁，阿Q提起這一句「不多不多」這一定在肚子裏也一動，單四嫂子張著嘴的看，照例。', 74461, '9783400763294', '開消……發了一封“黃傘格”的意思再問，仍舊只是嚷，蚊子在這一羣孩子聽得我們這班小鬼見閻王”。這六個彎，阿五罵了。他移開桌子，有時也遇不見了，人都叫他喘氣平靜下來的消去了。 \"我惶恐而且兩三回，所以伊。', '2021-06-30 09:01:00', '2021-06-30 09:01:03'),
