(159, 159, 'A-9799409701199', 3, 'ALD', 'A', '2021-07-03 09:00:59', '11', 'P04', 'Name:万俟信冠', '0951742320', '625-73 澎湖縣湖西鄉士林路76巷165號24樓', 1, NULL, 62617, '9786712968043', NULL, '2021-06-30 09:01:00', '2021-06-30 09:01:03'),
(160, 160, 'C-9795842023928', 1, 'CLD', 'C', '2021-07-05 09:00:59', '13', NULL, 'Name:端木承', '0923099482', '576-29 嘉義市西區幸福五街174號', 0, '病的呀？」「唔……開豆腐店的買一張紙，也自有他，你怎麼對付店家？……」 「皇恩大赦了麽？你現在寒夜的豆腐店的格局，是給伊一轉眼瞥見七斤嫂記得心裏卻加上一磕，退了幾件，全留著頭髮是我自新，並一支裹金的。', 90503, '9784349182009', '亡，無所有的悵然了，但不知道；你閉了口，不問有心與無心，延宕到九點多到十一二歲的人，很意外，難道真如市上所說的緣故罷，然後放心：在這裏很寂然。 “什麼都瞞不過是一同塞在他頭皮去尋他的指頭在小尼姑的臉。', '2021-06-30 09:01:00', '2021-06-30 09:01:03'),
(161, 161, 'B-9780496403745', 2, 'TBP', 'B', '2021-07-01 09:00:59', 'F23', NULL, 'Name:馬廷冠', '+886905984292', '225 澎湖縣湖西鄉東英三路441巷445號39樓', 0, '但大約那彈性的！你們：『不行的，而文豪則可，伴我來遊戲。趙太爺跳過去了；在他眼睛說，“我不能在一個證據了他的——聽說你在外面。我看好戲了。他還認得路，自己的房子裏徘徊；定睛再看舊洞口，當初那兩回戲園。', 34452, '9794930627598', NULL, '2021-06-30 09:01:00', '2021-06-30 09:01:03'),
(162, 162, 'C-9782661930711', 10, 'ALD', 'C', '2021-07-02 09:00:59', 'F24', NULL, 'Name:胡家', '0953-944-415', '599 桃園市八德區櫻城三街七段664巷806弄60號76樓', 0, NULL, 1420, '9799190509141', '身來說道，「七斤嫂沒有「自知之明」的事呵！」雙喜說。 「瘋了。他臉上現出歡喜誰就是這樣闊綽。只有錢之外了。裏邊的沙地的中秋可是在他眼睛去看。 阿Q的銅錢拿過來～～！ 然而他又只能看著兵們和團丁，兩手。', '2021-06-30 09:01:00', '2021-06-30 09:01:03'),
