(171, 171, 'B-9792857676804', 8, 'CLD', 'B', '2021-07-03 09:00:59', '3', NULL, 'Name:廉嘉', '(01)231-0376', '928-66 桃園市平鎮區龍善二路一段151巷837號47樓', 0, NULL, 44028, '9784754830373', '將到酒店門前的長毛時候不了著急，兩個字。 所以，人言嘖嘖了；便覺得沒有睡的既有名，甚而至於假，就是水生麽。微風拂拂的頗有些不通世故的話問你們可以都拿著往外只一擠，終於恭敬敬的形跡。伊為預防危險。因爲。', '2021-06-30 09:01:00', '2021-06-30 09:01:03'),
