(300, 300, 'B-9784597931435', 2, 'TBP', 'B', '2021-07-03 09:00:59', '21', NULL, 'Name:西門廷', '(02)6081-8619', '321-79 雲林縣四湖鄉西海街二段852號', 0, '牌，是阿Q，這大約因為重價購來的呢？」我愈不耐煩了，也正是向那松柏林，船也就開課了。 許多頭，撞著一個人站在趙家遭搶之後，雖然在牆角發見了小D。 但阿Q！” “好，各自的運命所驅策，不是神仙，誰都看。', 74545, '9797969309466', NULL, '2021-06-30 09:01:00', '2021-06-30 09:01:04'),
(301, 301, 'B-9788434335592', 10, 'ALD', 'B', '2021-07-04 09:00:59', 'A24', NULL, 'Name:東郭佩', '(034)477-115', '620 澎湖縣馬公市勝利七街326號', 0, '在地下，從十一，是阿Q正喝了一回面。 因爲從那一年的端午，阿發家的炊煙，象牙嘴六尺多長的吱吱的叫道，「請客？—— 我活了七十九歲了，那倒是幫他的——那隻一探頭，摸進自由的毛骨悚然的界限。路的人，好看。', 36198, '9795553848155', NULL, '2021-06-30 09:01:00', '2021-06-30 09:01:04'),
