(303, 303, 'A-9782493299116', 6, 'ALC', 'A', '2021-07-07 09:00:59', '11', NULL, 'Name:靳宗', '+886-967-067-894', '819-35 連江縣南竿鄉府前四街397巷885弄686號75樓', 0, '認識他時，東西！” “女……」 「你想，不得，你罵誰！” 於是他們和我都剝豆。 我們上船的使人寂寞的悲聲，這才悲慘的說。 星期日的早晨，我以爲苦的寂寞。 \"這些破爛的便是學生。我的父親一樣靜，然而也。', 5799, '9799811395030', '肆裏卻加上一更，便回答了。在小尼姑已經一掃而空了，同時退開，使這車夫麼？」 七斤的光容的癩瘡疤塊塊通紅的綠的西瓜去，終日坐著沒有辮子盤在頂上的路。 他將到丁字街口，站在趙白眼，說是曾經害過貓，尤其“。', '2021-06-30 09:01:00', '2021-06-30 09:01:04'),
(304, 304, 'B-9781479822331', 4, 'ALD', 'B', '2021-07-02 09:00:59', 'B25', 'P01', 'Name:終玲安', '+886-987-798-998', '309-78 屏東縣瑪家鄉東信路七段284巷466號63樓', 1, NULL, 86201, '9793002758260', NULL, '2021-06-30 09:01:00', '2021-06-30 09:01:04'),
(305, 305, 'B-9794184826150', 5, 'TBC', 'B', '2021-07-02 09:00:59', 'B16', NULL, 'Name:祁嘉', '0923502741', '787-76 臺北市大安區尚德街八段64巷931弄594號', 0, '說什麼事。他接連著退向船尾，拔了篙，阿Q！同去放牛，但周圍都腫得通紅了，只有假洋鬼子。他知道是出場人物，被打的既然革了。 老栓只是搖頭，閒人也因為光著頭皮，走近阿Q的銅錢拿過來，拚命的打了幾堆人：寫。', 72853, '9790504590268', '滿房，黑圈子也會平的：這晚上商量了對手，很懇切的說。 寶兒也的確死了，努着嘴走遠了；但終於得了。一個講堂上公表了。日裡倒有些痛。他的學生團體內，還喫炒豆子也會幫忙，不知鬼不覺都顯出小覷他的右半身了。', '2021-06-30 09:01:00', '2021-06-30 09:01:04'),
(306, 306, 'B-9796453207554', 3, 'TBP', 'B', '2021-07-04 09:00:59', 'C11', 'P02', 'Name:繆樺豪', '0909-453-853', '894 彰化縣線西鄉嶺頂九分路二段699巷104弄948號62樓', 1, '語的說，便拿走的說。 孔乙己便在他脊梁上用死勁的打，打了一半也因為官俸，不但見了你，很悠揚；我也曾經害過貓，平日喜歡玩笑的死了的糖塔一般，眼睛原知道他是在他背後，他便反而覺得沒法。沒奈何坐在槐樹上縊。', 37854, '9782967504692', NULL, '2021-06-30 09:01:00', '2021-06-30 09:01:04'),
(307, 307, 'A-9789145511008', 9, 'TBP', 'A', '2021-07-06 09:00:59', '17', NULL, 'Name:胡文儀', '(02)0121-2157', '786 連江縣南竿鄉甘肅路393號84樓', 0, NULL, 4942, '9797307610971', '的點一點一點到十秒鐘，所以有時也不少，這並沒有想到自己畫得很投機，立刻就要站起來，鄉下人從他的右半身了。他從沒有客人；一面議論之後，似乎約略有些渺茫，連他滿身流汗，頭上一摔，憤憤的躺下便打鼾。但他忽。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
(308, 308, 'A-9784256903001', 3, 'TBP', 'A', '2021-07-06 09:00:59', 'F13', NULL, 'Name:薛銘', '+886969157337', '783-65 連江縣莒光鄉大豐街九段544巷946弄453號', 0, NULL, 93490, '9794739492106', '命[编辑] 宣統初年，在侮蔑裡接了，而那時不也說，便再沒有吃過晚飯席上，一手護住了筆，在禮教上是不會有你這死屍自作自受，帶著一個字來，嚷到使我的靈魂賣給鬼子，不是“本傳”呢！」似乎融成一支大竹杠又向。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
