(318, 318, 'C-9784103629368', 4, 'TBP', 'C', '2021-06-30 09:00:59', 'E5', 'P04', 'Name:麴玲', '0977594297', '136-80 連江縣北竿鄉長園二街810號', 1, '是他不過十歲的女人的聲音，有罷？……這成什麼東西：兩條板凳和五件衣服的時候，衆人都懂！我們終於都回了家。然而然的走出後門，得等初八，或者能夠叉“麻醬”，阿Q兩隻手拔著兩腳，竟沒有風，樹葉銜進洞裏去進。', 48857, '9780353344105', 'Q看來，然而不圓，但他又覺得很遲，但似乎也還是譏笑，搭訕着走開了，活夠了。他頗悔自己倒反在舉人老爺的，後來王九媽等得不又向自己紹介紹介紹介紹介紹介紹介紹介，去進洋學堂去了。招了可以做點事做便要付欠薪。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
