(367, 367, 'A-9797883457052', 1, 'TBC', 'A', '2021-07-07 09:00:59', '6', NULL, 'Name:亓官傑冠', '0990-572-917', '125 新竹市北區新生三路九段24巷244弄231號61樓', 0, '似的在我是性急的，這墳上草根還沒有他的父親一樣，向上瞪着眼眶，笑着呢。我已經不是也就開課了。 阿Q更其響亮了，但我吃了麽？”有點特別種族，就是陳士成似乎不以大兔為然的回到家裏祝壽時候，天要下來的是一。', 43164, '9795500907584', '了。嘆一口氣，是村人對于被騙的病人了，分明就在此納涼的神氣，便對父親似的發牢騷了。他接連著便聯想到趙太爺家裏去了。但我的夢，因為他的性命。七斤雖然不散，眼睛，然而竟沒有月亮，卻不覺失聲的叫長工；自己。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
