(372, 372, 'B-9786367841623', 1, 'TBP', 'B', '2021-07-04 09:00:59', '7', 'P01', 'Name:陶佳', '(08)056-9438', '232-50 新竹縣尖石鄉縣政六路851巷229號', 1, '什麼規矩。那兩匹又出來了。」「他喘不過，最先自然一定是皇帝坐了龍庭，而且那些土財主的原因。幾回，我歡喜誰就是沒有追贓，他便對老栓接了孩子，有的事呵！他們沒有聲音，「怕什麼事物，被無形的蛇矛。一犯諱。', 42734, '9789434330020', NULL, '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
