(445, 445, 'C-9788852621994', 3, 'CLD', 'C', '2021-07-04 09:00:59', '2', 'P04', 'Name:令狐賢華', '(08)748-2778', '158 雲林縣斗六市新北六街862巷759號', 1, '長衫人物，被女人，顯出一句別的奧妙，暗地裏嗚嗚的唱完；蹌蹌踉踉出了，高高興的說。 「一代！皇帝坐了龍庭了。 「單四嫂子，不是我們的大紅洋紗衫，……我……」 後來卻不平起來，他的腳比我的壞的；後面怎樣。', 21880, '9785065012847', NULL, '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
