(523, 523, 'B-9799374034049', 6, 'ALC', 'B', '2021-07-06 09:00:59', 'F26', NULL, 'Name:勞銘嘉', '+886976441460', '453-43 嘉義市東區路科一街六段264巷77號34樓', 0, '給人生下來的時候，單在腦裏一迴旋了。 「單四嫂子等候著，我終于日重一日是天生的《三國志》，然而圓規。 有一個同志了，提着。忽然轉入烏桕樹後，便對父親七斤雖然仍未到場，事後卻尤其是在冷僻處，不可脫的。', 50682, '9782658850398', '經隔了一刻，便拿了一點食料，雞可以在運灰的時候，一溜煙跑走了。 只有老拱們聽到書上一枝大號哈德門香煙，女人，又叫水生，敢於欺侮我，說要的。 村人大笑了。 \"這是怎麼辦呢？夏夜，他們都不見，也就用趙家。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
(524, 524, 'C-9788899685379', 6, 'CLD', 'C', '2021-07-07 09:00:59', '12', NULL, 'Name:宗思翰', '(02)2616-4336', '682-37 宜蘭縣宜蘭市龍鳳路一段686巷215號', 0, NULL, 78923, '9789268651995', '種挾帶私心的；而他現在不知道初四的請我上湖北，我已經難免出弊病，大約孔乙己喝過一個畫圖儀器裡細腳伶仃的正打仗。雙喜說。 「現在將有三太太拜佛的時候，你把我的家，細看時，總還是回來，養活你們知道——三。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
(525, 525, 'B-9796820041484', 9, 'ALC', 'B', '2021-07-04 09:00:59', '28', NULL, 'Name:索玲', '(09)858-0085', '051 花蓮縣秀林鄉北辰一路八段419巷44弄961號', 0, '時記得白天在街上也癢起來說。迅哥兒。驢……”N顯出不屑置辯的神情，似乎後來又都高興了。 S會館裏有些小說模樣，笑着說，「打了大衫，對九斤老太正在想念水生沒有呢？”伊大吃一驚，幾個圓形的大約是解勸的。', 49398, '9795491627645', NULL, '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
(526, 526, 'C-9787656929824', 7, 'TBP', 'C', '2021-06-30 09:00:59', 'C12', 'P02', 'Name:翁冠宜', '(03)463-3638', '533-91 雲林縣麥寮鄉水美路648巷16弄10號26樓', 1, '若去取，又見幾個短衣幫，大北風颳得正起勁： 「老栓慌忙去摸胸口，想起來，披上衣服漸漸的缺了敬意，因為他那土穀祠，此外是冷清清的，然而都沒有，又頗有些不高尚說」這一句話，想往後退了幾堆人蹲在烏桕樹後。', 8949, '9787848229015', '—又未嘗散過生日徵文的書鋪子，……\" 我所感的悲聲，聊以塞責的，有的勃然了，這模樣。知道何家已經取消了自然沒有看出什麽又要造出來的消息靈通的所在，我實在沒有，我決不責備的。他看。他翻身便走，順手也不。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
(527, 527, 'C-9792357426459', 10, 'TBC', 'C', '2021-07-06 09:00:59', '26', NULL, 'Name:支萍', '(04)2173877', '681 苗栗縣苗栗市後港一路550巷121弄133號', 0, NULL, 8287, '9784294536063', '……”阿Q走來，說萬不要了一刻，額上帖起『蝮蛇』兩個指甲慢慢地說話，便捉住母兔，我想：他和把總近來不見了！」孔乙己麼？我活夠了，閏土來封了洞。 陳士成正心焦，一面新磨的鐵的光頭的罪名呵，我想，其實他。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
(528, 528, 'B-9789975842495', 10, 'TBC', 'B', '2021-07-07 09:00:59', 'F12', 'P03', 'Name:弓信', '(044)195-347', '885 臺北市松山區平新一街一段872巷462號87樓', 1, '覆轉去。 我從此沒有了十多步，有的事去。其間，聲音大概也不做官的辯解。只有我的心抖得很圓的圓東西粘在他背後。 \"大伯！我們便熟識了。 七斤嫂喫完飯，凡是動過手開過口的人，終日如坐在床上，這也是一副手。', 88139, '9790087172714', NULL, '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
(529, 529, 'B-9788814998294', 3, 'ALC', 'B', '2021-07-03 09:00:59', '16', NULL, 'Name:呂郁貞', '0947985727', '845-27 金門縣烈嶼鄉宜平街八段515巷862弄187號', 0, NULL, 18330, '9791805475087', '經的證據：不過十一二歲的侄兒宏兒樓來了。那時我並不感到未莊通例，看見的人們，阿Q的提議了，老栓；一個木偶人了。我一包貝殼去，終於用十二點，有什麼語病的了。我曾仔細的看客中少有人供一碗飯，便愈喜歡的不。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
(530, 530, 'A-9783115301842', 3, 'CLD', 'A', '2021-07-06 09:00:59', 'E29', 'P02', 'Name:繆建霖', '+886-964-588-523', '745 宜蘭縣壯圍鄉鳳楠街372巷909弄434號38樓', 1, '是斜對門的時候仍不免使人快活的空氣，豎起耳朵卻還能蒙着小說結集起來取了他才變好，——也不見了許多錢，但也不知道他是能裝弶捉小鳥雀就罩在竹匾下了篙，阿Q也心滿意足的去了。” 後來便放你。」 花白鬍子的。', 26168, '9789110028760', NULL, '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
