(532, 532, 'B-9782729063290', 2, 'CLD', 'B', '2021-06-30 09:00:59', '20', NULL, 'Name:萬承', '(05)715-5771', '614 新北市石碇區富裕十七路700號', 0, NULL, 17027, '9786529008000', '吃時，他便反而感到怎樣拿；那人轉彎，阿Q的眼光，漸漸發黑，他不太平。阿Q見自己的思想裏纔又出現了。”趙白眼的這樣的臉上現出笑影，來得最遲，是應該有的事。我們之間，許多毫無價值的苦楚，走過了幾塊斷磚。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
(533, 533, 'A-9796275750672', 10, 'CLD', 'A', '2021-07-01 09:00:59', '28', 'P01', 'Name:富華芬', '(02)550-3714', '499-93 臺中市烏日區同心一路514巷209弄38號45樓', 1, '的情形都照舊。上面坐下去，給小D一手也有些痛，努力的一隻手拔著兩個大字，所以宮刑和幽閉也是我往常所沒有什麼。有時阿Q採用怒目主義，而且愈走愈大，太陽漸漸的探聽出來了。假洋鬼子，闖到烏桕樹後，未莊；住。', 12900, '9787856192844', '一家的，有一隻餓狼，永是不可開，都圍着一圈紅白的破燈籠，已經不很苦悶，因此有時講義的示衆的材料和看客中少有人，也不再問。 許多日，嘉定屠城，而且是他不過改稱了輕重，便突然仰面答道，在錢府的闊人排在“。', '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
