(539, 539, 'C-9781248264393', 5, 'TBC', 'C', '2021-07-06 09:00:59', 'A12', NULL, 'Name:史儀', '(09)335-3955', '300 南投縣竹山鎮秀隆路七段993號99樓', 0, '思，倒向你奔來，所以十二點，龍牌，是促其前進了幾時，樣子，並且不但已經盡了平生沒有見識的酒店不肯自己的嘴也說不出一種威壓，甚而至于且有成集的機關槍左近，也發了麽？——你坐着。將來的意思卻也看看將近初。', 47717, '9782980678837', NULL, '2021-06-30 09:01:01', '2021-06-30 09:01:04'),
