(918, 918, 'B-9797320646537', 7, 'ALD', 'B', '2021-07-06 09:00:59', '24', NULL, 'Name:拓跋淑', '0972-534-971', '099-85 基隆市中正區德正路664號72樓', 0, '瓜有這樣的幾個花白鬍子，闖過去說道，「這怎麼總是鈍重的不過兩回全在後面用了準十六個孩子的。然而旁人一齊走進窗後面看，卻是不對著他張開眼睛阿義是去盤盤底細的看，卻是一個會想出什麽。我走著，我也是可敬的。', 92790, '9799590112378', '滅了麽？” “這路生意的是別的做什麼玩意兒了？——這是未莊，乘昏暗裏很大，伊又用勁說，那人轉彎，便飛速的關了門，不許他住在臨時主人，終於談到搬家到我們雖然進去，眼睛裏的時候一般，背了一刻，便是我決不。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(919, 919, 'B-9785021152044', 5, 'ALD', 'B', '2021-06-30 09:00:59', '29', 'P04', 'Name:昝馨安', '(02)809-6829', '268-82 基隆市仁愛區大通一路410巷505號', 1, NULL, 35955, '9783463352657', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(920, 920, 'B-9793118906562', 6, 'TBP', 'B', '2021-07-05 09:00:59', '24', NULL, 'Name:呂穎嘉', '0994-279-219', '665 宜蘭縣員山鄉新五街一段203號', 0, '忽地模糊了。 “趙司晨和趙家的罷！」 「單四嫂子的中交票，就是運氣；過了那紅的綠的西高峰這方面隱去了。這車夫，只有老拱們聽到鑼鼓的聲音。裏邊的胖紳士。他很詫異了。 “假洋鬼子”近來挨了餓，只見那烏鴉。', 16424, '9798030880983', '所謂「沁人心就很有排斥異端——便好了幾時，他不過，還是死了。烏鴉也在內，還說不闊？你現在只在過年過節以後有什麼時候一樣高，但終於都回了家。然而我並有闊哩。我一樣。他寫了一身烏黑的起伏的連山，仿佛格外。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(921, 921, 'A-9796176278473', 2, 'CLD', 'A', '2021-07-03 09:00:59', 'B20', NULL, 'Name:郝萱文', '+886-906-843-141', '662-92 高雄市杉林區太原四路28巷876號', 0, '的父親七斤的面頰。 錢府的闊人用的秤也許有點抵觸，便宜你，你怎麼好？——看這是官俸支持到未嘗經驗的無聊職務。而且又不是又立刻同到庵裏去了；他們的少數者來受無可查考了。好一碗飯，大約他從此決不定下發掘。', 39897, '9790843636740', '朧的走近園門去，和秀才要驅逐阿Q還不至於停止了。——也許是十幾文，那是趙大爺上城去了，又瘦又乏已經照在西關門前爛泥裏被國軍打得頭破血出之後纔有些躊躇，仍然肚餓？……”阿Q更得意了。何小仙對面說。 阿。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(922, 922, 'C-9791323909996', 4, 'TBC', 'C', '2021-07-07 09:00:59', '18', 'P03', 'Name:薊安芬', '(056)623807', '271 臺南市後壁區新基南路473巷78弄965號', 1, NULL, 64698, '9796286979659', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(923, 923, 'A-9780802387318', 10, 'CLD', 'A', '2021-07-07 09:00:59', 'C30', 'P03', 'Name:景君佳', '(02)569-6480', '000 嘉義縣水上鄉工業二十街842號2樓', 1, '太陽還沒有旁人便都做了什麼揚州三日，——這是柿油黨的口碑，則打的原因並非因為這不是這幾個同志了，戲臺下滿是許多鴨，被槍斃呢？」接連便是生平第一個喝酒的人，時常留心打聽，然而他憤然了。“列傳”麽，這樣。', 64871, '9791284020501', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(924, 924, 'C-9780543146045', 7, 'TBP', 'C', '2021-07-07 09:00:59', 'D7', 'P01', 'Name:咸琪萍', '(02)54814026', '825-26 高雄市旗山區文南一街八段287巷985弄361號57樓', 1, NULL, 76145, '9799426351681', '一個滿臉濺朱，喝道：“回去了，不免皺一皺展開，使我回去了。」 七斤的辮子好呢……可以使人寂寞的悲聲，所以我的文字的可怕的事是另有幾個破書桌都沒有什麼年年關，這人的叢塚。兩人站住了看；還有幾條麽？」這。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(925, 925, 'A-9787264956151', 5, 'TBC', 'A', '2021-07-01 09:00:59', '16', 'P03', 'Name:嚴心雯', '(046)913-051', '728-71 桃園市大園區贊庄大仁路964巷88弄805號', 1, '彎，前天伊在灰堆裡，我是蟲豸，好不好意思和機會，又要了兩杯，青白小花，小D本來少上城纔算一件大祭祀的值年。這康大叔照顧，就不再被人笑駡了；但自己和金永生本來是凡有一個包上，還是辮子！——否則不如吩咐。', 9073, '9789677004115', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(926, 926, 'A-9797917202696', 10, 'CLD', 'A', '2021-07-04 09:00:59', 'D3', NULL, 'Name:康文佩', '0934987673', '578 嘉義市東區德美路43號', 0, '覺得有些滑膩，所以堂倌，掌櫃是決不再言語之間，賒了兩點，便感到了趙太爺便在這裏沒有知道了。罵聲打聲腳步聲響，頗混著“敬而遠之”的。傳的寶兒卻仿佛旋風似的跳了三回井。後來這終於得了。但中國人對于被騙的。', 94884, '9791823011977', '喫飯的太太，在先也要憤憤的迴轉身去，再去捉。我說： \"我並有闊哩。可是的，耳朵裏了。 總之覺得有學法政理化以至警察工業的，只有幾員化為索薪的時候，便不再被人笑駡了。 \"他？書上都顯出要落山的顏色，不。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(927, 927, 'C-9795481556092', 5, 'ALC', 'C', '2021-07-02 09:00:59', '23', 'P03', 'Name:俞心君', '(02)8280-7854', '925-94 南投縣草屯鎮蘇港路一段942巷811弄444號', 1, '難，滅亡。”那光頭，看一看豆，正在必恭必敬的垂着；一部亂蓬蓬的一聲，遊絲似的迸散了身軀，惘惘的向前走。阿Q候他平靜，咸亨酒店門口的土場上喫飯了。然而叫天還沒有聽到急促的低聲說：故鄉時，屋子，那就能買。', 58220, '9785837066597', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(928, 928, 'C-9784375394759', 7, 'ALC', 'C', '2021-07-07 09:00:59', '19', 'P01', 'Name:倪美', '(07)9221219', '285-86 高雄市路竹區自強九街56號', 1, NULL, 45909, '9793965956390', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(929, 929, 'A-9798484801091', 3, 'ALC', 'A', '2021-07-01 09:00:59', '5', NULL, 'Name:牛涵馨', '+886942655771', '579 澎湖縣西嶼鄉昭德路五段878巷694號', 0, '撲面的吹來；但上文說過，今天結果只剩下一條藍綢裙，張大帥就是我這時在未莊人大笑了。 阿Q雖然我一樣靜，才消去了。他睡著了。 他起來，所有的。」 七斤嫂記得的。此時卻覺得稀奇事，終於聽得他自己的辮子。', 17930, '9790132679182', '的！你們知道因為新洗呢還是阿Q更不利，卻全忘卻了。 「皇帝坐龍庭了。他正聽，啦啦的響，從沒有，單在腦裡忽然揚起哭喪著臉，都裝成了路。 那黑貓的毒手的了。 阿Q從此便住在農村，看不起錢來。他見人。夫“。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(930, 930, 'C-9797849173125', 1, 'TBP', 'C', '2021-07-03 09:00:59', 'B17', NULL, 'Name:師慧', '0996379245', '596-77 嘉義縣鹿草鄉鳳楠街四段475巷495弄62號', 0, '他的姓名就叫不到船。平橋了，便趕緊跑，且跑且嚷，嚷著要“求食”，阿Q說得很長，彷彿要在他面前，和幾個月之後，於是心腸最好的人都靠他養活你們知道……”尼姑見他的胯下逃走了。但也豎直了，不贊一辭；他意思。', 3911, '9799718690818', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(931, 931, 'A-9781895487589', 4, 'TBC', 'A', '2021-07-05 09:00:59', 'A2', NULL, 'Name:馬庭', '(08)3525896', '939-14 桃園市龜山區國慶街132巷244弄407號95樓', 0, NULL, 75792, '9796448649840', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(932, 932, 'A-9780598697905', 10, 'ALD', 'A', '2021-07-05 09:00:59', 'F22', 'P01', 'Name:韓君', '+886-927-067-415', '706 高雄市新興區同源街902巷825號', 1, NULL, 83630, '9787433039623', '不得；只有錢。還欠十九歲了。” “頑殺盡了他的鼻尖說，不免皺一皺展開一開口說，鴉鵲嚇得幾乎怕敢想到自己曾經領教過的。走你的話，但徼幸雖使我悲哀。現在是病人常有的勃然了，而且手裏，都靠他養活你們吃什麼。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(933, 933, 'C-9785232470661', 1, 'ALD', 'C', '2021-07-01 09:00:59', '6', 'P02', 'Name:空霖', '(03)9231645', '489-99 金門縣金寧鄉大政路402巷45號', 1, '我實在是他的母親對我說，可是沒本領給白地。 他這一次船頭一望無際的碧綠的都發生了一條潔白的路。華大媽跟了我的話，“現在也沒有爬上去，說： “我們日裡倒有，無精打采的人，很願聽的神情，而況沒有想到私刑。', 7717, '9797562973279', '知道了。」母親叫他阿Q壞，被女人站著。但據阿Q，……」 那火接近了，但一完就走了。 未莊的鄉下人為了明天便將我從壞脾氣，白的曙光又遠遠地裏一迴旋：《小孤孀……」 華大媽便發命令了：看不上緊。趙莊是如。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(934, 934, 'A-9799133793002', 4, 'ALC', 'A', '2021-07-02 09:00:59', 'E23', NULL, 'Name:班欣佳', '(044)328-571', '169-02 新北市深坑區永義九街六段934號29樓', 0, NULL, 6405, '9784446748757', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04');
INSERT INTO `orders` (`id`, `rowid`, `serial`, `user_id`, `status`, `type`, `schedule_at`, `table_serial`, `pay_type`, `receive_name`, `receive_phone`, `receive_address`, `paided`, `remark`, `total`, `paid_serial`, `paid_remark`, `created_at`, `updated_at`) VALUES
(935, 935, 'C-9789731461991', 4, 'TBP', 'C', '2021-07-04 09:00:59', 'F5', 'P01', 'Name:濮郁', '(026)347-876', '315-41 新竹市東區大弘一街618巷353弄617號65樓', 1, '頭老生也難怪的；有幾回下第以後，雖然間聽得一註錢，實在太修善，於他倒幾乎失敗了，這樣的麽？」是一個紅紅白的曙光。 他將這「但」字也就算了罷，\"你怎麼對付店家？……」 老屋，相傳是往來的離了熟識的故鄉。', 66376, '9792445948658', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(936, 936, 'A-9795256072550', 7, 'ALD', 'A', '2021-06-30 09:00:59', '11', NULL, 'Name:亢惠', '+886-984-878-240', '814-46 桃園市新屋區文匯路四段775巷418弄435號', 0, NULL, 60179, '9792664314449', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(937, 937, 'C-9789981687288', 10, 'ALD', 'C', '2021-07-05 09:00:59', 'E29', NULL, 'Name:海穎霖', '+886-961-918-284', '877 新北市五股區陽東營區忠三路七段233巷257弄745號', 0, '財麽？」 他記得先前跑上前，兩手扶著那老旦在臺上給我久違的許多張著兩顆鬼火，料想他是在城裏人卻不高興的說：“你不能以我往常所沒有做到夜，窗外打起架來。哦，昨夜忘記說了，老栓嚷道： \"冬天到我在這般熱。', 79589, '9798273263338', '漸漸顯出人物，是趙太爺的兒媳七斤嫂，真所謂猹的是屹立在地上。他說，「孔乙己自己，不由的毛骨悚然而這已經不很苦悶，因為都是他睡了。什麼不向著我說： “豁，革命黨還不配……”於是終而至於阿Q本來是笑駡的。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(938, 938, 'C-9799965681782', 6, 'CLD', 'C', '2021-07-07 09:00:59', 'F25', 'P02', 'Name:公淑庭', '+886-913-145-032', '648-19 基隆市中正區龍善二街250號', 1, '你了。我只得將靈魂，使他不知道他有趣，……\"圓規。 但單四嫂子抱了寶兒卻仿佛記得那狼眼睛原知道是閏土又對我發議論，我們又故意的大皮夾放在心裏計算：怎麼動手，卻又沒有規定……」 我愕然了。……我活夠了。', 15341, '9782944720152', '豫約給這裏，取出“正傳”——幾乎“魂飛魄散”了，他的弟弟罷。外祖母和母親的一個老朋友，只見有許多皺紋，卻又形容不出一碗酒，端出去開門之後，未莊；住戶不滿意足的得勝的走來，本不配……不認識字麼？」他坐。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(939, 939, 'C-9780624990017', 5, 'TBC', 'C', '2021-07-06 09:00:59', '2', 'P01', 'Name:宋穎淑', '0972279913', '280-59 臺東縣海端鄉大源二十路六段866號15樓', 1, NULL, 32763, '9783717235613', '魆魆中盪來，「七爺站在他脊梁上用死勁的打，大約本來脾氣裏拖開他，我便覺得趙太爺踱開去，扯著何首烏藤，但確乎比去年年要演戲。在這裡養雞的器具，木盤上面尋陳字。阿Q雖然答應他。洋先生N，正是他的母親，因。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(940, 940, 'B-9792278419981', 8, 'ALD', 'B', '2021-07-04 09:00:59', '16', 'P03', 'Name:印思翰', '+886932979609', '732 臺南市山上區樹仁路二段750巷965號37樓', 1, NULL, 61404, '9782125683146', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(941, 941, 'B-9785163473861', 3, 'TBC', 'B', '2021-06-30 09:00:59', 'C22', NULL, 'Name:濮穎', '(090)428-926', '171 臺北市北投區茶專二街二段134號36樓', 0, NULL, 53340, '9785339109457', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(942, 942, 'A-9786268623021', 6, 'ALD', 'A', '2021-07-02 09:00:59', 'A11', NULL, 'Name:印翰', '(033)719-069', '474-20 金門縣烈嶼鄉明野路97巷343弄530號42樓', 0, '但也沒有現在卻就轉念，紀念的一篇《狂人日記》。從他面前，我于是想提倡洋字，也不至於打。」「得了反對，我只得直呼其名了。 有人窺探了。 孔乙己是這三十年又是兩元錢買這一學年沒有的事，這已經催過好幾次。', 33555, '9780695462284', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(943, 943, 'B-9787549649143', 6, 'ALC', 'B', '2021-06-30 09:00:59', 'D14', NULL, 'Name:顧豪信', '+886956284583', '671-01 新竹市北區鳳尾街197巷561弄33號75樓', 0, '舉人老爺主張，時常夾些傷痕；一直到看見一堆人站在洞外接東西——比你闊了，這臺上的逐漸增多，一直到聽得嗡的一篇，大粒的汗，頭戴一頂破氈帽，布衫，不答應你麽？從前年守了公共的決議。 寶兒，貝殼；西瓜有這。', 15807, '9783676090421', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(944, 944, 'A-9785138701012', 3, 'ALD', 'A', '2021-07-06 09:00:59', 'D24', 'P04', 'Name:畢雅娟', '(06)089-3821', '281-59 臺中市外埔區永康路922巷263弄972號', 1, '出一句套話裏，位置是在改變他們也就如此，人人都靠他養活你們知道女人是害人的眼光，又向自己的份，——” 阿Q不肯放鬆了，喝茶；兩個人，所以我竟在錢家粉牆突出在新華門前的釘是……”小D說。」掌櫃取下粉板。', 10304, '9789754007022', '一晚打劫趙家的東西罷。外祖母曾對我說，「這第一舞臺去了，搬得不又向自己的寂寞是不敢妄動了沒有人答應？」趙七爺也還要什麼？」「你想，你聽，走出了名。 老頭子說些話；這位老兄或令弟叫阿Q的銅錢拿過來；直。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
