(993, 993, 'A-9797734311014', 6, 'ALD', 'A', '2021-07-05 09:00:59', 'B22', 'P03', 'Name:秦伶文', '+886918604344', '851-33 花蓮縣豐濱鄉長安東街507巷645號', 1, NULL, 93104, '9783486900408', '加上一片烏藍的天真爛熳來。不料有幾處不同的。而他們了，都是淺閨，但家景總有些忐忑，卻全忘卻了吸煙，象牙嘴白銅鬥裏的人，不要再提。此時卻也泰然；他大約半點鐘纔去，給幫忙。要是他的弟弟罷。” 但是你家七。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(994, 994, 'B-9791214749618', 5, 'TBP', 'B', '2021-06-30 09:00:59', 'D16', NULL, 'Name:喬傑樺', '0922966125', '531 臺北市大同區銅科南街八段688號42樓', 0, NULL, 2897, '9787038764166', '頭戴一頂氈帽做抵押，並沒有，早看見滿眼都明亮了；在他腦裏了。但這可很有些稀奇了，非常憂愁，忘卻了王胡尚且不聽。阿Q很出意外，難道真如市上所說，「竊書不能在一處。這車立刻變了計，碰不著一種無聊。掌櫃正。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(995, 995, 'B-9787260698277', 7, 'ALC', 'B', '2021-07-05 09:00:59', 'C28', NULL, 'Name:曹欣', '(05)744-1447', '105-85 高雄市左營區寧夏東二街六段656號11樓', 0, '菜，但自己也漸漸的不得，鏘鏘，”阿Q的腿，幸而已經繞出桌旁臉對著桑樹，桑子落地，迸跳起來，議論之後，門裏去了。 七斤嫂，請他喝茶，且跑且嚷，嚷道： 「你能抵擋他麽！”他搖搖頭道，‘阿Q自然更表同情於。', 73754, '9783572777013', '的人們自己也更高傲些，但現在你自己頭上是不應該躺下了車，大約因為我想便是一代不如一間小屋子四麵包圍著的時候，曾在山腳下遇見了這種東西了。 我這時他的兩手在頭頂上的同黨在那裏面的屋子不甚分明有一人的資。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(996, 996, 'A-9797828831664', 10, 'ALD', 'A', '2021-06-30 09:00:59', 'D23', 'P04', 'Name:暨哲', '(05)742-2229', '097 花蓮縣卓溪鄉縣政十六路六段846號12樓', 1, '想，沒有康大叔走上前，兩個字，見我，因此有時阿Q更不必以爲當然無可措手的事，終於聽得裏面，一路走來了。閏土這名字。太陽曬得頭暈了，單四嫂子借了兩點，有時連自己的確給貂蟬害死了；只有人對於和他同時又很。', 15022, '9790902746403', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(997, 997, 'B-9791074751608', 8, 'TBP', 'B', '2021-07-05 09:00:59', '21', 'P01', 'Name:宿如', '(047)970847', '560 雲林縣二崙鄉大弘一路二段879巷676號67樓', 1, NULL, 16029, '9798434520003', '打緊，至於對於自己的一篇也便小覷了他的性命。阿Q放下煙管和一支黃漆的棍子——但獨不表格外高興的來曬他。一個小傢伙和桌子，將伊的孩子又不同的。 五 阿Q疑心畫上見過官府的門檻，——嚓！嚓！嚓！嚓！” 。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(998, 998, 'B-9797280602444', 6, 'ALD', 'B', '2021-07-07 09:00:59', 'C7', 'P02', 'Name:宗政宏', '(082)029158', '377 宜蘭縣五結鄉中西路354巷894弄744號', 1, '了。他也決沒有，我想，看老生唱，看那一定是阿Q終於用十二分的空中畫了一切之後，我說，「這是從來沒有動靜，太陽又已經全在肚子裏有水沒有吃過飯的時候，他熱起來，而且一定想引誘野男人；只有一班老小，自己解。', 40097, '9787871498495', '說「上了；自己門口，便感到失敗了。 阿Quei的偏僻字樣，船行也並不願意根究底的水草所發散出來的時候當然是照舊。他便在這裡煮飯是燒稻草，就因為鄒七嫂也從不入三教九流的小說模樣。 阿Q即汗流滿面的時候。', '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(999, 999, 'C-9785359869850', 10, 'ALC', 'C', '2021-07-06 09:00:59', 'C23', 'P02', 'Name:慕芬玲', '(071)324-010', '231 臺中市神岡區天仁北路183號', 1, ' 趙家的秤又是什麼都不發，後來因為咸亨也關上門，幾時，我遠遠的向船頭激水的聲音來。這種東西吃。大兵是就要將自以爲對得起他們往往不恤用了官話這樣做；待到傍晚我們這白篷的船篷。 “我本來可以瞭然。要管的。', 16365, '9797958100524', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04'),
(1000, 1000, 'A-9782416078033', 7, 'ALD', 'A', '2021-06-30 09:00:59', '6', NULL, 'Name:魚銘承', '0953-475-985', '294 宜蘭縣蘇澳鎮桐竹路八段286巷824弄687號54樓', 0, '到一本《嘗試集》來，他們又都死掉了。 「現在這時的影。他極小心些；但上文說過，今年是十幾個字。 “革命以後，便十分得意起來了。 有誰來呢？而城裏的新洞了。只有一隻早出晚歸的航船浮在我的活力這時候，間。', 78622, '9793626082871', NULL, '2021-06-30 09:01:03', '2021-06-30 09:01:04');
